import React from 'react';

import Layout from '../components/layout';

class About extends React.Component {
  state = {};

  render() {
    return (
      <Layout style={{margin: '0px 15px'}}>
        <h1>FAQs</h1>
      </Layout>
    );
  }
}

export default About;
